import React from 'react'
import { BrowserRouter } from 'react-router-dom/cjs/react-router-dom';

const NotPageFound = ()=>{
    return(
        <BrowserRouter>
            <div>
                <h1>Welcome</h1>
                <p>This ios blog Site.</p>
            </div>
        </BrowserRouter>
    )
}

export default NotPageFound
